import { useEffect } from "react"

// const { Component } = require("react");

function Counter(){
    const[Count,setCount]=React.useState(0)
    function Incremant(){
setCount(Count+1)
    }
    useEffect(()=>{
       setCount(Count+1) 
    },[])
    return(
<>
<button onClick={Incremant}>lick Here</button>
<p>{Count}</p>
</>
    )
}
export default Counter
